import axios from "axios";
import { Baseurl } from "../../baseUrl";

const btcRateReducer = (state = {name:'', sex:''}, action) => {
    let token = localStorage.Token
    switch (action.type) {
      case "RATE":
        return state = {name:token, sex:'f'}
      default:
        return state;
    }
  };
  export default btcRateReducer;
